import { useEffect, useState } from "react";
import { getSkills } from "./services/api";

function App() {
  const [skills, setSkills] = useState([]);

  useEffect(() => {
    getSkills().then(setSkills);
  }, []);

  return (
    <div>
      <h1>My Glow Skills</h1>
      <ul>
        {skills.map((s) => (
          <li key={s.id}>{s.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
